%[text] # 课题 1 ： 可激发系统的模拟： Hodgkin-Huxley 神经元模型
%[text] 
%[text] ## 可激发系统
%[text] 
%[text]  可激发介质/系统 (excitable medium/system): 简言之就是具有 “可激励性”的介质, 也叫激励介质  
%[text] “可激励性”所对应的英文单词是“excitability”. 这个词在不同 的学科里有不同的译法: 物理学中叫可激发性, 医学中叫兴奋性、 敏感性, 生理学中叫刺激反应性 这里所指的“可激励性”是当介质 受到小扰动时, 介质很快恢复到平衡态 (静态); 但当扰动超过某一 阈值时, 介质将有一个快速又陡峭的响应, 呈现激发状态  
%[text] ## 神经元
%[text] 大脑中神经元数目巨大 ~10^11  
%[text] 神经元形状及其多样  
%[text] 
%[text] 图中的标注及其翻译：
%[text] Soma ：胞体
%[text] $\\textrm{Neurites}\\textrm{：神经突}\\left\\lbrace \\begin{array}{ll}\n\\textrm{Dendrites}\\textrm{树突} & \\\\\n\\textrm{Axon}\\textrm{：轴突} & \n\\end{array}\\right.${"editStyle":"visual"}
%[text] ## 神经元的可激发性
%[text] ![](text:image:1682)
%[text] 图中的标注及其翻译：
%[text]   Action potential ：动作电势
%[text]   Depolarization ：去极化
%[text]   Repolarization ：复极化
%[text]   Failed initiations ：失败的启动
%[text]   Threshold ：阈值
%[text]   Resting state ：静息态
%[text]   Stimulus ：刺激
%[text]   Refractory period 不应期
%[text] 
%[text] 神经元在受到刺激时膜电位随时间变化的过程，称为**动作电势** 
%[text] 
%[text] **Y轴 :** 电压，单位：mV 神经元细胞膜内外的电位差  
%[text] \*\*X轴:\*\*时间，单位：毫秒
%[text] - **三个电位水平 Potential Levels:**
%[text] - **Resting state (静息态):** 约 -70 mV 神经元在未受刺激时的稳定电位
%[text] - **Threshold (阈值):** 约 -55 mV 临界电位
%[text] - **峰值:** 约 +40 mV 动作电势达到的最高电位
%[text] - **事件：** \
%[text] 1. **Stimulus (刺激):** 在 1 ms 稍过一点的位置，一个外部刺激被施加
%[text] 2. **Failed initiations (失败的启动):** 图中阈值下方的小波形  这表示刺激强度太弱，没有使膜电位达到 -55 mV 的阈值，因此无法触发一个完整的动作电势，电位很快就回落到静息态
%[text] 3. **Depolarization (去极化):** 当一个足够强的刺激使膜电位达到阈值 (-55 mV) 后，膜电位开始急剧上升，从负值变为正值，一直达到 +40 mV 的峰值
%[text] 4. **Action potential (动作电势):** 整个快速的电位“尖峰”（从去极化开始到复极化结束）被称为动作电势  图中的标签也特指其峰值
%[text] 5. **Repolarization (复极化):** 达到峰值后，膜电位迅速下降，从 +40 mV 降回负值
%[text] 6. **Refractory period (不应期):** 膜电位在复极化后，会短暂地降到比静息态（-70 mV）更低的水平  在这个时期，神经元对新的刺激反应能力降低（或完全不反应）  之后，电位会逐渐恢复到 -70 mV 的静息态   \
%[text] ## 动作电势的特性
%[text] ![](text:image:1f07)
%[text] 
%[text]   Injected current ：注入电流
%[text] 1\.  If injected current does not depolarize the membrane to threshold, no action potentials will be generated.
%[text]     如果注入的电流没有使细胞膜去极化到阈值，则不会产生动作电势  
%[text] 2\.  If injected current depolarizes the membrane beyond threshold, action potentials will be generated.
%[text]     如果注入的电流使细胞膜去极化超过阈值，则会产生动作电势  
%[text] 3\.  The action potential firing rate increases as the depolarizing current increases.
%[text]     随着去极化电流的增加，动作电势的发放频率增加 
%[text] 
%[text] ## 神经元的数学建模
%[text] 
%[text] ### 细胞膜与离子通道
%[text] 
%[text]   channel 通道
%[text]   pore 孔隙
%[text]   lipid bilayer 脂双层
%[text] 
%[text] ### 等效电路
%[text] 等效成了三个电阻和一个电容并联，并且在每个电阻的回路串上电池，每个电迟代表了对应离子的能斯特电位，电阻则代表了离子泵的耗能
%[text] 这个模型中的能量来源是电池提供的，即营养物质的摄入
%[text] #### PPT上指出的公式
%[text] ![](text:image:56c9)
%[text] $C\_m \\frac{dV\_m }{dt}+I\_{ion} =I\_{ext}${"editStyle":"visual"}
%[text] $I\_{ion} =\\sum\_k I\_k =\\sum\_k G\_k (V\_m -E\_k )\\ldotp${"editStyle":"visual"}
%[text] 这里的$I\_{ext}${"editStyle":"visual"} 是外部总电流，$I\_{ion}${"editStyle":"visual"}指离子电流之和
%[text] 离子有三种，Na， K，还有泄露（主要是氯离子）
%[text]  $V\_m${"editStyle":"visual"} 是指内外模的电势差，$G\_k${"editStyle":"visual"}指电导
%[text] #### PPT中给出的微分方程是
%[text] $&dollar&;&dollar&;\n\\begin{cases}\nC\_m \\frac{dV}{dt} = -g\_L(V-E\_L) - \\bar{g}\_{Na} m^3 h (V-E\_{Na}) - \\bar{g}\_K n^4 (V-E\_K) + I\_{app} \\\\\n\\frac{dm}{dt} = \\alpha\_m(V)(1-m) - \\beta\_m(V)m \\\\\n\\frac{dh}{dt} = \\alpha\_h(V)(1-h) - \\beta\_h(V)h \\\\\n\\frac{dn}{dt} = \\alpha\_n(V)(1-n) - \\beta\_n(V)n\n\\end{cases}\n&dollar&;&dollar&;$
%[text] 
%[text] HH 模型描述了动作电势的发生过程  
%[text] #### PPT中给出的参数是
%[text] 电容：$C = 1 \\mu\\text{F/cm}^2$
%[text] 
%[text] 各离子的能斯特电位和对应的电导：
%[text] $\\begin{array}{lrr}\n\\hline\\hline\nx & E\_x \\text{ \[mV\]} & g\_x \\text{ \[mS / cm}^2\\text{\]} \\\\\n\\hline\n\\text{Na} & 55 & 40 \\\\\n\\text{K} & -77 & 35 \\\\\n\\text{L} & -65 & 0.3 \\\\\n\\hline\\hline\n\\end{array}$
%[text] 对应的 alpha和beta函数：
%[text] $\n\n\n\n\n\n\\begin{array}{lcc}\n\\hline\\hline\nx & \\alpha\_x (u / \\text{ mV}) \\text{ \[ms}^{-1}\\text{\]} & \\beta\_x (u / \\cdot \\text{ mV}) \\text{ \[ms}^{-1}\\text{\]} \\\\\n\\hline\nn & 0.02(u-25) / \[1-e^{-(u-25)/9}\] & -0.002(u-25) / \[1-e^{(u-25)/9}\] \\\\\nm & 0.182(u+35) / \[1-e^{-(u+35)/9}\] & -0.124(u+35) / \[1-e^{(u+35)/9}\] \\\\\nh & 0.25 e^{-(u+90)/12} & 0.25 e^{(u+62)/6} / e^{(u+90)/12} \\\\\n\\hline\\hline\n\\end{array}$
%[text] 
%[text] #### 文献中给出的微分方程：
%[text] 
%[text] 根据《Energy and information in Hodgkin-Huxley neurons》A. Moujahid, A. d’Anjou, and F. J. Torrealdea
%[text] 突奇-赫胥黎HH模型描述了无动作电位传播的鱿鱼巨轴突，将其视为通用神经元动力学的代表，遵循以下微分方程：
%[text] $\\\[\n\\begin{array}{rcl}\nC \\dot{V} &=& -i\_{Na} - i\_K - i\_l + I, \\\\\n\\dot{m} &=& \\alpha\_m(V)(1-m) - \\beta\_m(V)m, \\\\\n\\dot{n} &=& \\alpha\_n(V)(1-n) - \\beta\_n(V)n, \\\\\n\\dot{h} &=& \\alpha\_h(V)(1-h) - \\beta\_h(V)h,\n\\end{array}\n\\quad (1)\n\\\]$
%[text] 
%[text] 其中 $V${"editStyle":"visual"} 是以 $mV${"editStyle":"visual"} 为单位的**膜电位**，$C${"editStyle":"visual"} 是以 $\\mu F${"editStyle":"visual"} 为单位的**膜电容**
%[text] $I${"editStyle":"visual"} 是以 $\\mu A/cm^2${"editStyle":"visual"} 为单位的**总膜电流密度**
%[text] 而 $&dollar&;m&dollar&;$、$&dollar&;n&dollar&;$ 和 $&dollar&;h&dollar&;\n$ 是无量纲变量
%[text] 分别表示**膜内侧钠激活分子的比例**、**膜内侧钾激活粒子的比例**
%[text] 以及**膜外侧钠失活分子的比例** 。
%[text] 
%[text] A. Moujahid文章中的钠、钾和泄漏 (主要是氯) 的离子电流，分别记为 $&dollar&;i\_{Na}&dollar&;$、$&dollar&;i\_K&dollar&;$
%[text] 和 $&dollar&;i\_l&dollar&;$，由下式给出：
%[text] 
%[text] $\\\[\n\\begin{array}{rcl}\ni\_{Na} &=& g\_{Na} m^3 h (V - E\_{Na}), \\\\\ni\_K &=& g\_K n^4 (V - E\_K), \\\\\ni\_l &=& g\_l (V - E\_l),\n\\end{array}\n\\quad (2)\n\\\]$
%[text] 
%[text] 其中 $&dollar&;g\_{Na}&dollar&;$、$&dollar&;g\_K&dollar&;$ 和 $&dollar&;g\_l&dollar&;$ 是各自离子通道电导的最大可能值，并且
%[text] $&dollar&;E\_{Na}&dollar&;$、$&dollar&;E\_K&dollar&;$ 和 $&dollar&;E\_l&dollar&;$ 离子在神经元静态状态下的能斯特电位。在这
%[text] 项工作中，我们给出了这些参数的标准常数值，这些值在下表中给出。
%[text] #### 文献中给出的参数是
%[text] 膜电容为  $C = 1 \\mu\\text{F/cm}^2$
%[text] 电压标度被偏移,使得静息电位为零
%[text] $\n\n\\begin{array}{lrr}\n\\hline\\hline\nx & g\_x \\text{ (mS/cm}^2\\text{)} & E\_x \\text{ (mV)} \\\\\n\\hline\n\\text{Na} & 120 & 115 \\\\\n\\text{K} & 36 & -12 \\\\\n\\text{l} & 0.3 & 10.6 \\\\\n\\hline\\hline\n\\end{array}$
%[text] A. Moujahid文章中随时间变化的变量alpha和beta函数是
%[text] 
%[text] $\\\[\n\\begin{array}{rcl}\n\\alpha\_m(V) &=& (2.5 - 0.1V) / \[\\exp(2.5 - 0.1V) - 1\], \\\\\n\\beta\_m(V) &=& 4 \\exp(-V/18), \\\\\n\\alpha\_n(V) &=& (0.1 - 0.01V) / \[\\exp(1 - 0.1V) - 1\], \\\\\n\\beta\_n(V) &=& 0.125 \\exp(-V/80), \\\\\n\\alpha\_h(V) &=& 0.07 \\exp(-V/20), \\\\\n\\beta\_h(V) &=& 1 / \[\\exp(3 - 0.1V) + 1\].\n\\end{array}\n\\\]$
%[text] 
