%[text] ## 任务 1：研究不同刺激强度下神经元膜电势的变化
%[text] 
%[text] 
%[text]   请利用四阶 Rung=Kutta 算法求解 HH 方程, 并研究不同刺激强度下神经元膜电势的变化, 借此理解可激发系统的响应特性  
%[text] 
%[text] 脉冲刺激 或 直流刺激
%[text] 
%[text] 解答：
%[text] 我们将分别对 脉冲刺激 或 直流刺激 使用PPT中的参数和方程 文献中对应的参数和方程 ，因此组合后结果应该有四种：
%[text] 我们先复现PPT中的结果：
%[text] ### 
%[text] 
