%%
%[text] 
%[text] ## 扩展：
%[text] 如果 V 是膜电位，电路中在给定时刻累积的总电能为
%[text] $&dollar&;H(t) = \\frac{1}{2}CV^2 + H\_{Na} + H\_K + H\_l, \\quad (3)&dollar&;$
%[text] 其中求和的第一项代表电容器中累积的电能，另外三项分别是电池中的能量。电池中累积的电化学能是未知的。在该模型中，它可能是无限的，因为我们没有考虑电池的耗尽。在真实的神经元中，营养物质的摄入防止了离子泵的耗尽。然而，已知电池向电路提供的电能速率是流过电池的电流乘以其电动势。因此，上述能量对时间的全导数将是
%[text] $&dollar&;\\dot{H}(t) = CV\\dot{V} + i\_{Na}E\_{Na} + i\_K E\_K + i\_l E\_l. \\quad (4)&dollar&;$
%[text] 设 $&dollar&;I&dollar&;$ 代表以某种方式注入膜的总外部电流。根据方程 (1) 中的第一个方程，我们有
%[text] $&dollar&;C\\dot{V} = I - i\_{Na} - i\_K - i\_l,&dollar&;$
%[text] 将其代入方程 (4) 可得
%[text] $&dollar&;\\dot{H} = VI - i\_{Na}(V - E\_{Na}) - i\_K(V - E\_K) - i\_l(V - E\_l).&dollar&;$
%[text] 如果我们将方程 (2) 代入离子电流，我们得到电路中的能量速率为
%[text] $&dollar&;\\dot{H} = VI - g\_{Na}m^3h(V - E\_{Na})^2 - g\_K n^4 (V - E\_K)^2- g\_l(V - E\_l)^2, \\quad (5)&dollar&;$
%[text] 
%[text] 这提供了神经元中电化学能量关于其状态变量的全导数。 右手边求和中的第一项表示通过到达神经元的不同连接给予神经元的电功率,而求和中的其他三项表示离子通道每秒消耗的能量。由于发放率取决于总电流 I， 霍奇金赫胥黎神经元的平均代谢消耗作为发放率的函数可以通过简单评估式(5) 在不同外部电流值下 I。以下两节介绍了这些计算的结果。
%[text] #### 动作电位生成中的能量消耗速率
%[text] 能量供应就是 $VI$，(5)的后三项 $- g\_{Na}m^3h(V - E\_{Na})^2 - g\_K n^4 (V - E\_K)^2- g\_l(V - E\_l)^2$ 就是能量的消耗

T=100;%总时长(ms)
fs= 12*T;%采样频率
A=6.9;%刺激电流强度
t=0:T/fs:T;%时间序列向量
Del=t(2)-t(1);%时间间隔
N=length(t);%时间离散化数量

I_ext = @(u) 0+(0.1*T<=u & u<= 0.9*T).*A;%脉冲刺激向量
[V,m,h,n]=Task3I2V(C,E,g,Alpha,Beta, ...
    'fs',fs, ...
    'T',T, ...
    'A',A, ...
    'I_ext',I_ext,...
    'IfPic',0,...
    "IfDebug",0);

Espl=V.*I_ext(t);
Ecost=-g.Na.*m.^3.*h.*(V-E.Na).^2-g.K.*n.^4.*(V-E.K).^2-g.L.*(V-E.L).^2;
figure('Name','动作电位生成中的能量的供给和消耗速率') %[output:106063b9]

subplot(3,1,1); %[output:106063b9]

yyaxis left %[output:106063b9]
plot(t,I_ext(t),'r') %[output:106063b9]
hold on %[output:106063b9]
title('(a)外部电流刺激I_{ext}-t+膜电压V-t') %[output:106063b9]
xlabel('t/ms'); %[output:106063b9]
ylabel('I_{ext}(\muA/cm^{2})') %[output:106063b9]

yyaxis right %[output:106063b9]
plot(t,V,'b') %[output:106063b9]
xlabel('t/ms') %[output:106063b9]
ylabel('V/mv') %[output:106063b9]

subplot(3,1,2); %[output:106063b9]
plot(t,Espl,'r'); %[output:106063b9]
xlabel('t/ms'); %[output:106063b9]
ylabel('E(nJ/s)') %[output:106063b9]
title('(c)能量供给') %[output:106063b9]

subplot(3,1,3); %[output:106063b9]
plot(t,Ecost,'B'); %[output:106063b9]
xlabel('t/ms'); %[output:106063b9]
ylabel('E(nJ/s)') %[output:106063b9]
title('(d)能量消耗') %[output:106063b9]
%[text] (a)外部刺激电流时域图，峰值在I = 6.9 $\\mu $A (b) 在 I = 6.9 $\\mu $A 下生成的动作电位。 (c) 突触连接处每秒的能量供应。 (d) 离子通道处总的每秒的能量耗散。
%[text] 如图(a)，外部电流刺激是蜂值为I = 6.9 μA/cm2，持续80ms的方波。在此外部电流值下,神经元以约 58赫兹的频率持续放电。图1(b) 显示了一个生成的动作电位序列。时间以毫秒为单位,膜电位从极化状态下零下几毫伏变化到去极化后的100毫伏。图 1(c) 描绘了随时间变化的电能速率,对应于在方程(5)的右侧的第一项 VI 。它平均为正,峰值达到约600纳焦/秒。它表示对神经元的净能量贡献,其来源取决于电流的来源 I。在实验电极记录的情况下,电极钳制设备将是能量的来源。如果 I 来自突触,这种能量贡献表示在突触连接处每秒供应的能量。在图1(d) 中表示了神经元的总代谢能量消耗。该图描绘了方程(5)的最后三项对能量导数的总贡献。注意它是负的,因为他表示在离子通道处每秒的瞬时总能量消耗。这种电化学能量消耗达到峰值接近100,000nJ/s,并且远大于由 VI 项供应的能量。这种能量速率是否离子泵补充,并通过ATP分 子的水解代谢供应,来维持神经元的活动的。
%[text] 
