function [fPkz, EcostEach, I,Espl,Qint,Nint] = parfor_TaskProI2V_fast(N_A,Avec,I_template, C, E, g, Alpha, Beta, VPASol, fs, T)

    %  启动并行池,没有则自动开
    p = gcp('nocreate'); if isempty(p), parpool; end

    %  预分配结果
    fPkz = zeros(1, N_A);

    % 建立数据通道 并 回调（从 worker 发消息到客户端打印进度）
    dq = parallel.pool.DataQueue;
    done = 0;
    afterEach(dq, @onUpdate);

    % 并行循环,do , 报告 完成1次
    parfor i = 1:N_A
        % fprintf('%d / %d \n',i,N_A);
        A = Avec(i);
        I_ext_vec = A * I_template; %脉冲刺激向量

        [V, m, h, n] = Task2I2V_fast(C, E, g, Alpha, Beta, VPASol, ...
            'fs', fs, ...
            'T', T, ...
            'A', A, ...
            'I_ext', I_ext_vec ...
            );
  
   
        % E_Na_series = -g.Na.*m.^3.*h.*(V-E.Na).^2;
        % E_K_series  = -g.K.*n.^4.*(V-E.K).^2;
        % E_L_series  = -g.L.*(V-E.L).^2;

        %各离子平均能量消耗
        EcostEach(i).Na=mean(-g.Na.*m.^3.*h.*(V-E.Na).^2);
        EcostEach(i).K=mean(-g.K.*n.^4.*(V-E.K).^2);
        EcostEach(i).L=mean(-g.L.*(V-E.L).^2);

        Espl(i)=mean(V.*I_ext_vec);%平均能量供应

        %各离子平均电流
        I(i).K=mean(-g.K.*n.^4.*(V-E.K));
        I(i).L=mean(-g.L.*(V-E.L));
        I(i).Na=mean(-g.Na.*m.^3.*h.*(V-E.Na));

        % 有了电流，可以计算交换的电荷量和离子数
        IK=-g.K.*n.^4.*(V-E.K);
        IL=-g.L.*(V-E.L);
        INa=-g.Na.*m.^3.*h.*(V-E.Na);
        %穿过膜的各离子电荷量
         t=0:T/fs:T;%时间序列向量
        QK=trapz(t,IK);
        QL=trapz(t,IL);
        QNa=trapz(t,INa);

        Qint(i).K=QK;
        Qint(i).L=QL;
        Qint(i).Na=QNa;
        % fprintf('穿过膜的各离子电荷量(C)：\n')
        % disp(Qint)
        e=1.602176634e-19 %元电荷电量
        %穿过膜的各离子个数
        Nint(i).K=QK/e;
        Nint(i).L=QL/e;
        Nint(i).Na=QNa/e;
        % fprintf('穿过膜的各离子个数：\n')
        % disp(Nint)

        %每次A取值时的频率计算
        Threold = max(V) * 2/3;
        % findpeaks(V.*(V>=Threold));
        [pks, locs] = findpeaks(V .* (V >= Threold));
        NPkz = length(pks);
        fPkz(i) = NPkz / (0.8 * T * 1e-3);

        % disp(fPkz)
        send(dq, 1); % 告诉客户端又完成了 1 次
    end

    % 换行收尾
    fprintf('\n完成。\n');

    % 客户端回调 每收到一次 send(dq,1) 就更新一回
    function onUpdate(~)
        done = done + 1;
        % 单行覆盖输出 已完成/总数
        fprintf('\r已完成：%d/%d (%.1f%%)', done, N_A, 100 * done / N_A);
    end

end

%[text] 图3(a) 显示了 长序列动作电位的钠和钾电流的平均值。对于外部电流 的值 I 在I = 4 和 6.2 μA/cm2 神经元处于静息状态而不发放。在此区域,钠通道的小电导使该电流保持在非常低的值。钾电流略大,补偿了泄漏和外部电流。
%[text] 对于较大的外部电流值 I ，神经元获得递增发放率的强直发放状态。钠和钾电流的平均值清楚地检测到过渡并随着发放率的增加而增加。
%[text] 在图3(b) 中,显示了单位时间总能量消耗(所有三个通道)作为施加电流 I 函数的平均值。能量消耗的垂直突然增加清楚地揭示了从低电流值 I 下的静息状态无发放到由较大施加电流 值诱导的发放状态的过渡。与尖峰生成相关的更高能量需求清晰可见;
%[text] 例如,在 I = 6.9 μA/cm2,处,这是先前 分析的动作电位序列生成所用的值,平均代谢消耗约为 9000 nJ/s。此消耗必须通过代谢ATP供应来补充。对应于不同电流值 I 的发放频率显示在插图中。
%[text] 图3(c) 显示 了由 V I 项提供给神经元的每秒平均能量。它随电流 I 线性增加,在静息和发放状态下具有不同的斜率。它始终远低于离子通道的耗散。
%[text] 在图3(d) 中,显示了总能量消耗与通过膜的钠离子数三分之一的比值。该比值以电子伏特每ATP表示,并代表ATP水解的效率,测量为在模型中由一个ATP分子水解提供的自由能。如图所示,该比值在整个 I 在I = 6.2 和 10 μA/cm2值范围内是恒定的; 也就是说,它与发放率无关。
%[text] 因此,我们的结果表明,在发放期间,钠钾泵要求每个ATP分子0.39电子伏特,这与文献中估计的一个泵送周期(将两个钾离子移入细胞和三个钠离子移出细胞) 的0.37电子伏特非常一致 \[20\]。这一结果也与报道的数据一致,即一个ATP分子可以释放0.43电子伏特的自由能 \[21\],, 
%[text] 这意味着ATP使用效率很高,只有10%的释放自由能以热能形式损失。另一方面,当神经元处于静息状态时,模型中ATP水解所需的效率为0.51电子伏特,略大于一个ATP 分子可以释放的能量。这一结果指出霍奇金‐赫胥黎模型在神经元静息时低估了钠离子的数量。
%[text] 
%[text] #### 
%[text] 
%[text] ### 两个电耦合神经元的能量平衡
%[text] 
%[text] 
%[text] 间隙连接通道允许两个神经元的细胞内电位直接连接在一起，通常被称为电突触。当两个或多个神经元耦合在一起时,它们很常见,并在细胞事件的同步中发挥重要作用。特别是,它们在传输信息和同步神经元群的信息方面很高效 \[22\]。尽管对称性是电突触的预期特性, 但文献中也报道了不对称间隙连接。例如,在视网膜中, 有证据表明信号传输从AII无长突细胞到ON锥双极细胞的方向比另一个方向更有效 \[18\]。这种功能整流可以通过两种细胞类型之间膜输入电阻的相应差异来解释。在本工作中,为了保持信息传输的明确方向,我们研究了完全不对称的单向间隙连接。
%[text] 
%[text] #### 单向耦合的定义
%[text] 
%[text] ![](text:image:4cf3)
%[text] 图4.电单向耦合；霍奇金‑赫胥黎电路。
%[text] 
%[text] 间隙连接通道可以直接连接两个神经元的胞体或在神经突的末端形成接触位点。无论如何,我们认为接触位点不贡献于电路的电容 \[22\]。两个神经元都遵守方程集(1)并附加一个影响突触后神经元的耦合。
%[text] $\\\[\n\\begin{array}{rcl}\nC \\dot{V} &=& -i\_{Na} - i\_K - i\_l + I, \\\\\n\\dot{m} &=& \\alpha\_m(V)(1-m) - \\beta\_m(V)m, \\\\\n\\dot{n} &=& \\alpha\_n(V)(1-n) - \\beta\_n(V)n, \\\\\n\\dot{h} &=& \\alpha\_h(V)(1-h) - \\beta\_h(V)h,\n\\end{array}\n\\quad (1)\n\\\]$
%[text] 突触前神经元的膜电流密度已被表示为 $&dollar&;I\_{\\text{Stimulus}}(t)&dollar&;$，一个推测由兴奋性外部刺激诱导的电流。它已被建模为均值 $&dollar&;0 \\, \\mu\\text{A}&dollar&;$ 和方差 $&dollar&;9 \\, \\mu\\text{A}&dollar&;$ 的高斯噪声。高斯噪声的刺激输入参数均值和方差已通过实验选择,以便它们在突触前神经元的脉冲序列中产生足够的变异性。这个熵的脉冲序列在我们的工作中保持统计不变,并已被用作信息源。
%[text] 
%[text] 突触后神经元,推测是一个中间神经元,暴露于一个总噪声电流 $&dollar&;I\_{\\text{noise}}&dollar&;$，该电流被建模为均值 $&dollar&;0 \\, \\mu\\text{A}&dollar&;$ 和方差 $&dollar&;1 \\, \\mu\\text{A}&dollar&;$ 的高斯噪声。这个噪声可以推测为到达突触后神经元的不规则信号的均值,来自我们不特别考虑的其他突触。这个噪声没有引入到突触前神经元,在将其视为刺激电流的一部分方面没有特殊困难。
%[text] 
%[text] 每个神经元的膜电位的两个方程是：
%[text] $&dollar&;&dollar&;C\_1 \\dot{V\_1} = I\_{\\text{Stimulus}}(t) - i\_{1Na} - i\_{1K} - i\_{1l}, \\quad (6)&dollar&;&dollar&;$
%[text] $&dollar&;&dollar&;C\_2 \\dot{V\_2} = I\_{\\text{Noise}}(t) - i\_{2Na} - i\_{2K} - i\_{2l} + I\_{\\text{Junction}}.&dollar&;&dollar&;$
%[text] 
%[text] 通过连接的电流是 $&dollar&;I\_{\\text{Junction}} = k(V\_1 - V\_2)&dollar&;$，其中参数 $&dollar&;k&dollar&; $是间隙连接的电导,或称耦合强度,单位是 $\\text{mS/cm}^2$。电流 $I\_{\\text{Stimulus}}(t)$ 代表刺激突触前神经元的可变电流,该电流携带由神经元传输的信息, 而 $I\_{\\text{Noise}}(t)$ 表示通过其他突触到达突触后神经元的总噪声电流。
%[text] 
%[text] 因此,在单向耦合中,不允许电流从突触前神经元流入或流出。然而,连接电流 $k(V\_1 - V\_2)$ 仍然必须通过电连接流入接收神经元。图4展示了一个可能的电路,该电路实现了两个霍奇金‐赫胥黎神经元之间的单向耦合。 连接处的电势差由一个具有单位增益和极高输入阻抗的放大器维持,该放大器使第一个神经元在能量上独立于第二个神经元。突触后神经元在连接处所需的能量由放大器提供。放大器提供电流 $I\_{\\text{Junction}}$ 在电压 $V\_1$；也就是说, 功率 $V\_1 I\_{\\text{Junction}}$。对应于突触后神经元的电路中的电能, 这是唯一受耦合影响的部分,现在是：
%[text] $&dollar&;&dollar&;H\_2(t) = \\frac{1}{2} C\_2 V\_2^2 + H\_{2Na} + H\_{2K} + H\_{2l} + H\_{\\text{Amplifier}}, \\quad (7)&dollar&;&dollar&;$
%[text] 这是电容器中累积的电能加上三个电池中的电化学能量加上放大器中可用能量的总和。第二个神经元中的总能量导数由：
%[text] $&dollar&;&dollar&;\\dot{H\_2} = V\_2 I\_{\\text{noise}} - g\_{2Na} m\_2^3 h\_2 (V\_2 - E\_{2Na})^2 - g\_{2K} n\_2^4 (V\_2 - E\_{2K})^2 - g\_{2l} (V\_2 - E\_{2l})^2 + k V\_2 (V\_1 - V\_2) + k V\_1 (V\_1 - V\_2). \\quad (8)&dollar&;&dollar&;$
%[text] 三个离子通道在这个导数右侧的联合贡献在整篇论文中被用来计算突触后神经元的代谢消耗。最后两项代表突触中的能量平衡,这对应于在突触的突触后部位消耗的能量加上由放大器贡献的能量。注意,突触中这个代谢能量的净消耗不一定是负的,因此突触本身可能是一个主动供应者。无论如何,能量并非来自信号神经元,它提供信息但不提供能量。
%[text] 
%[text] #### 单向耦合的计算结果
%[text] 
%[text] 
%[text] 平均代谢能量消耗,作为耦合电导的函数 $k$,对于单向耦合的两个神经元,如图5所示。代谢能量消耗是通过方程(7)中所有三个离子项的贡献计算的,对于突触后神经元,以及突触前神经元的等效项。由于脉冲序列是嘈杂的,一些随机特性(如能量消耗速率)的收敛需要长时间的平均。为了执行这个计算,平均值取自一个750秒长的动作电位序列。曲线是针对耦合电导绘制的 $k$, 并且我们在表示中反转了能量导数的实际负号。由于耦合是单向的,连接的电导对突触前神经元没有影响,其平均代谢能量消耗保持恒定在约 $9000 \\, \\text{nJ/s}$。突触后神经元起始于 $k = 0 \\, \\text{mS/cm}^2$,消耗约 $500 \\, \\text{nJ/s}$,这对应于其静息状态,偶尔被随机兴奋所改变。随着耦合强度的增加,代谢消耗逐渐增加,直到在耦合强度值约为 $k = 0.1 \\, \\text{mS/cm}^2$ 时,达到几乎与突触前神经元相同的消耗水平。 此时,突触后神经元的放电频率已达到突触前神经元的水平。平均放电频率如插图所示。
%[text] 
%[text] 图5.(彩色在线)在不同突触电导 $k$ 值下,发送和接收神经元离子通道的平均代谢能量消耗。突触前神经元的刺激电流 $I\_{\\text{Stimulus}}(t)$，推测由兴奋性外部刺激引起,已建模为均值 $0 \\, \\mu\\text{A}$、 方差 $9 \\, \\mu\\text{A}$ 的高斯噪声。突触后神经元,推测是负责传输信息的中间神经元,暴露于总噪声电流 $I\_{\\text{noise}}$，推测通过我们未具体考虑的其他突触到达,建模为均值 $0 \\, \\mu\\text{A}$、方差 $1 \\, \\mu\\text{A}$ 的高斯噪声。 插图显示了两个神经元的平均放电频率作为电导 $k$ 的函数。单向耦合。
%[text] 
%[text] 图6. (彩色在线) 从细胞外介质供应的每秒平均能量和在突触后部位向细胞外介质的平均耗散,在不同突触电导 $k$ 值下。 插图中显示了连接处的净能量导数,其为正的;也就是说,从突触有能量的净收入。单向耦合。
%[text] 
%[text] 我们还分析了单向突触连接中的能量平衡。由于神经元之间不能有任何能量流动,突触后神经元只能与细胞外环境交换离子和能量,尽管受突触前神经元控制。 在图6中,突触代谢能量的两个组成部分,即方程(7)的最后两项,已针对耦合电导绘制 $k$。第一项平均总是负的,表示在连接处的能量耗散。第二项总是正的,表示放大器传递给神经元的能量,代表从外部环境进入连接处的能量。因此,突触后神经元在连接处既耗散又吸收能量。图6中的插图显示了两部分的联合贡献。可以看出,对于神经元来说,平衡是正的;也就是说,通过突触位置有一个净的(尽管很小)能量收入,且该输入能量在高于 $k = 0.04 \\, \\text{mS/cm}^2$ 时达到一个尖锐的最大值。如图5所示,以及更清楚地在第III节中对于一组突触后神经元(见图10),在耦合电导的该值处,突触后神经元的代谢能量消耗似乎存在一个拐点。这一事实的相关性我们尚不清楚。
%[text] 
%[text] 
%[text]   对“Hodgkin-Huxley 神经元中的能量与信息”的评论  
%[text] Hideo Hasegawa 
%[text]  日本东京 184-8501 小金井市，东京学艺大学物理系 
%[text] （日期：2011 年 6 月 30 日）
%[text]   摘要  
%[text] 在最近的一篇论文 \[A. Moujahid, A. d'Anjou, F. J. Torrealdea and F. Torrealdea, Phys. Rev. E 83, 031912 (2011)\] 中，作者们使用 Hodgkin-Huxley (HH) 模型（霍奇金-赫胥黎模型）计算了神经元放电时消耗的能量。HH 模型采用的能量消耗率得出了负的能量消耗，这意味着能量从 HH 神经元转移到了源，这在物理上是奇怪的，尽管他们将其解释为生化能量成本。我提出了功耗的另一种表达式，该表达式导致 HH 神经元消耗正能量，并提出了一些模型计算结果，与他们论文中的结果进行了比较。
%[text] PACS 分类号: 87.19.1l, 87.19.lg, 87.19.ly, 87.18.Sn
%[text] 
%[text] 
